%script
BEGIN
      EXECUTE IMMEDIATE 'DROP Table OT_P_Table';
      EXECUTE IMMEDIATE 'DROP Table OT_TV_Table';
      EXECUTE IMMEDIATE 'DROP Table OT_T_Table';
      EXECUTE IMMEDIATE 'DROP Table OT_V_Table';

  EXCEPTION
     WHEN OTHERS THEN NULL;
END;
/
Create table OT_P_Table as SELECT ID, DAYOFMONTH, DAYOFWEEK, ORIGIN, ScheduledDeptTime, DEST, UNIQUECARRIER, AIRCRAFTCODE, ORIGINSKYCOND, ORIGINWINDSPEED,  DESTSKYCOND, DESTWINDSPEED
    FROM Int_Flights_Aircraft_Weather
    WHERE MONTH >=11; 

Create table OT_TV_Table as SELECT ID, DAYOFMONTH, DAYOFWEEK, ORIGIN, ScheduledDeptTime, DEST, UNIQUECARRIER, AIRCRAFTCODE, ORIGINSKYCOND, ORIGINWINDSPEED,  DESTSKYCOND, DESTWINDSPEED,  ARRDELAY 
    FROM Int_Flights_Aircraft_Weather
    WHERE MONTH <=10 ; 

Create table OT_T_Table as SELECT * from OT_TV_Table SAMPLE(70) SEED(1);

Create table OT_V_Table as SELECT * from OT_TV_Table
minus
select * from OT_T_Table; 
/

%script
select count(*) from OT_T_TABLE;
select count(*) from OT_V_TABLE;
select count(*) from OT_P_TABLE;

%script
/*  Clean up any previous GLM Models for notebook repeatability  */
BEGIN
  DBMS_DATA_MINING.DROP_MODEL('GLMR_OT_Model');
EXCEPTION WHEN OTHERS THEN NULL; 
END;
/
/*  Clean up and drop any previous GLM Model Settings table for notebook repeatability  */ 
BEGIN EXECUTE IMMEDIATE 'DROP TABLE GLMR_OT_Setting';
EXCEPTION WHEN OTHERS THEN NULL; END;
/
/*  Clean up and drop any previous Model Diagnostics table for notebook repeatability  */ 
BEGIN EXECUTE IMMEDIATE 'DROP TABLE GLMR_OT_Diag';
EXCEPTION WHEN OTHERS THEN NULL; END;

%script 
BEGIN 
/* Populate settings table  */
  INSERT INTO GLMR_OT_Setting(setting_name, setting_value) VALUES
    (dbms_data_mining.algo_name, dbms_data_mining.algo_generalized_linear_model);
  -- output row diagnostic statistics into a table named GLMR_OT_Diag
  INSERT INTO  GLMR_OT_Setting(setting_name, setting_value) VALUES
    (dbms_data_mining.glms_diagnostics_table_name, 'GLMR_OT_Diag');  
  INSERT INTO  GLMR_OT_Setting(setting_name, setting_value) VALUES
    (dbms_data_mining.prep_auto, dbms_data_mining.prep_auto_on);  
  -- turn on feature selection
  INSERT INTO  GLMR_OT_Setting(setting_name, setting_value) VALUES  
    (dbms_data_mining.glms_ftr_selection, 
    dbms_data_mining.glms_ftr_selection_enable);
  -- turn on feature generation
  INSERT INTO  GLMR_OT_Setting(setting_name, setting_value) VALUES 
    (dbms_data_mining.glms_ftr_generation, 
    dbms_data_mining.glms_ftr_generation_enable); 
END;

%script
BEGIN
  	EXECUTE IMMEDIATE 'DROP Table OT_Valid_Res';
  EXCEPTION
      WHEN OTHERS THEN NULL;
END;
/

create table OT_Valid_Res as select v.ID, a.MONTH,v.DAYOFMONTH, v.DAYOFWEEK, v.ORIGIN, v.ScheduledDeptTime, v.DEST, v.UNIQUECARRIER, a.flightnum, v.AIRCRAFTCODE, v.ORIGINSKYCOND, a.ORIGINVISIBILITY, v.ORIGINWINDSPEED, a.ORIGINPRESSURE, v.DESTSKYCOND, a.DESTVISIBILITY, v.DESTWINDSPEED, a.DESTPRESSURE, v.Delay, v.PredictedDelay
from (SELECT ID,  DAYOFMONTH, DAYOFWEEK, ORIGIN, ScheduledDeptTime, DEST, UNIQUECARRIER, AIRCRAFTCODE, ORIGINSKYCOND, ORIGINWINDSPEED,  DESTSKYCOND, DESTWINDSPEED, ROUND(ARRDELAY,1) Delay, ROUND(PREDICTION(GLMR_OT_MODEL USING *),1) PredictedDelay FROM OT_V_TABLE) v
join Int_Flights_Aircraft_Weather a
on v.id = a.id ;

%script
BEGIN
  	EXECUTE IMMEDIATE 'DROP Table OT_Pred_Res';
  EXCEPTION
      WHEN OTHERS THEN NULL;
END;
/

create table OT_Pred_Res as select v.ID, a.MONTH, v.DAYOFMONTH, v.DAYOFWEEK, v.ORIGIN, v.ScheduledDeptTime, v.DEST, v.UNIQUECARRIER, a.flightnum, v.AIRCRAFTCODE, v.ORIGINSKYCOND, a.ORIGINVISIBILITY, v.ORIGINWINDSPEED, a.ORIGINPRESSURE, v.DESTSKYCOND, a.DESTVISIBILITY, v.DESTWINDSPEED, a.DESTPRESSURE, v.PredictedDelay
from (SELECT ID,  DAYOFMONTH, DAYOFWEEK, ORIGIN, ScheduledDeptTime, DEST, UNIQUECARRIER, AIRCRAFTCODE, ORIGINSKYCOND, ORIGINWINDSPEED,  DESTSKYCOND, DESTWINDSPEED, ROUND(PREDICTION(GLMR_OT_MODEL USING *),1) PredictedDelay FROM OT_P_TABLE) v
join Int_Flights_Aircraft_Weather a
on v.id = a.id ;
